function isValidCCN(ccn) {
  return ccnIndexed.hasOwnProperty(ccn);
}

function isValidDept(dept) {
  return depts.hasOwnProperty(dept);
}

function deptNumbersForDept(dept) {
  if (!isValidDept(dept)) {
    return [];
  }
  var realDept = depts[dept];
  return Object.keys(deptIndexed[realDept]);
}

function isValidDeptNumber(dept, deptNumber) {
  return deptNumbersForDept(dept).includes(deptNumber);
}

function allDepts() {
  return Object.keys(depts);
}

function combineTime(days, start, end) {
  if (!days || !start || !end) {
    return '';
  }
  return days + ' ' + start + ' - ' + end;
}

function shortenRoom(room) {
  var newRoom = room;
  newRoom = newRoom.replace('Valley Life Sciences', 'VLSB');
  newRoom = newRoom.replace('Genetics Plant Bio', 'GPB');
  newRoom = newRoom.replace('Goldman School of Public Policy', 'GSPP');
  newRoom = newRoom.replace('Hearst Memorial Gymnasium', 'Hearst Gym');
  newRoom = newRoom.replace('Hearst Memorial Mining Building', 'Hearst Mining');
  newRoom = newRoom.replace('Hewlett-Packard Auditorium', 'HP Auditorium');
  return newRoom;
}

function lectureSectionFromCCN(ccn) {
  var data = ccnIndexed[ccn];
  return new Lecture({
    ccn: ccn.toString(),
    dept: data[0],
    deptNumber: data[1],
    section: data[2],
    type: data[3],
    desc: data[4],
    units: data[5],
    room: data[6],
    time: combineTime(data[7], data[8], data[9]),
    instructor: data[10]
  });
}

function lectureSectionsFromDept(dept, deptNumber) {
  if (!isValidDept(dept) || !isValidDeptNumber(dept, deptNumber)) {
    return [];
  }
  var realDept = depts[dept];
  var ccns = deptIndexed[realDept][deptNumber];
  return ccns.map(function (ccn) {
    return lectureSectionFromCCN(ccn);
  }).sort(function (a, b) {
    return a > b ? 1 : -1;
  });
}

